import Categories from './components/Categories';
import SortPopup from './components/SortPopup';
import Home from './page/Home';


function App() {
  return (
    <div className="wrapper">
      <Header logoSvg={logoSvg}/>
      <div className="content">
        <Home/>
      </div>
    </div>
  );
}

export default App;
